import React from 'react'

export default function ReviewItem(id, title, content, emotion, create_date) {
  return (
    <div className='ReviewItem'>
        <div key={id}>
            <p>영화 제목 : {title}</p>
            <p>리뷰: {content}</p>
            <p>평점 : {emotion}</p>
            <p>작성 시간 : {create_date}</p>
    </div>
    </div>
  )
}
